import React from 'react';
import { Box, IconButton } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import PersonIcon from '@mui/icons-material/Person';

const Navbar = () => {
  const navigate = useNavigate();

  return (
    <Box 
      sx={{
        position: 'absolute',
        bottom: 0,
        left: 0,
        right: 0,
        bgcolor: '#694504', // Background color
        boxShadow: '0px -4px 10px rgba(0, 0, 0, 0.5)', // Shadow on the top edge
        display: 'flex',
        justifyContent: 'space-around', // Space around icons
        alignItems: 'center', // Vertically center icons
        padding: '8px 0', // Uniform padding
        zIndex: 2000,
      }}
    >
      <IconButton 
        onClick={() => navigate('/profile')} 
        aria-label="Profile"
      >
        <PersonIcon fontSize="large" sx={{ color: 'black' }} /> {/* Black icon color */}
      </IconButton>
      {/* You can add more buttons here if desired */}
    </Box>
  );
};

export default Navbar;
